    required TResult orElse(),
  }) {
    if (adminAuth != null) {
      return adminAuth(this);
    }
    return orElse();
  }
}

abstract class AdminAuthState implements AdminNavigationState {
  const factory AdminAuthState() = _$AdminAuthState;
}
